import React from "react";
import DropdownSubmenu from "./DropdownSubmenu";

const DropdownItem = ({ item }) => {
  return (
    <div className="dropdown-item">
      {item.label}
      {item.submenu && <DropdownSubmenu items={item.submenu} />}
    </div>
  );
};

export default DropdownItem;
